    private function update_housing_price( HousingPrice $price, $postal_code, $date, $obj )
    {
        $price->postal_code                   = $postal_code;
        $price->date                          = $date;
        $price->property_type                 = $obj[ 'propertyType' ] ?? null;
        $price->bedrooms                      = $obj[ 'bedrooms' ] ?? null;
        $price->average_price                 = $obj[ 'averagePrice' ];
        $price->median_price                  = $obj[ 'medianPrice' ];
        $price->min_price                     = $obj[ 'minPrice' ];
        $price->max_price                     = $obj[ 'maxPrice' ];
        $price->average_price_per_square_foot = $obj[ 'averagePricePerSquareFoot' ];
        $price->median_price_per_square_foot  = $obj[ 'medianPricePerSquareFoot' ];
        $price->min_price_per_square_foot     = $obj[ 'minPricePerSquareFoot' ];
        $price->max_price_per_square_foot     = $obj[ 'maxPricePerSquareFoot' ];
        $price->average_square_footage        = $obj[ 'averageSquareFootage' ];
        $price->median_square_footage         = $obj[ 'medianSquareFootage' ];
        $price->min_square_footage            = $obj[ 'minSquareFootage' ];
        $price->max_square_footage            = $obj[ 'maxSquareFootage' ];
        $price->average_days_on_market        = $obj[ 'averageDaysOnMarket' ];
        $price->median_days_on_market         = $obj[ 'medianDaysOnMarket' ];
        $price->min_days_on_market            = $obj[ 'minDaysOnMarket' ];
        $price->max_days_on_market            = $obj[ 'maxDaysOnMarket' ];
        $price->new_listings_count            = $obj[ 'newListings' ];
        $price->total_listings_count          = $obj[ 'totalListings' ];
    }

